   static String[] concatenate(String[] a, String[] b) {
      int aLen = a.length;
      int bLen = b.length;

      String[] c = new String[aLen + bLen];
      System.arraycopy(a, 0, c, 0, aLen);
      System.arraycopy(b, 0, c, aLen, bLen);

      return c;
   }

   static String[] concatenate(String[] a, String[] b, String[] d) {
      int aLen = a.length;
      int bLen = b.length;
      int dLen = d.length;

      String[] c = new String[aLen + bLen + dLen];
      System.arraycopy(a, 0, c, 0, aLen);
      System.arraycopy(b, 0, c, aLen, bLen);
      System.arraycopy(d, 0, c, bLen, dLen);

      return c;
   }  

   static String[] concatenate(String[] a, String[] b, String[] d, String[] e) {
      int aLen = a.length;
      int bLen = b.length;
      int dLen = d.length;
      int eLen = e.length;

      String[] c = new String[aLen + bLen + dLen + eLen];
      System.arraycopy(a, 0, c, 0, aLen);
      System.arraycopy(b, 0, c, aLen, bLen);
      System.arraycopy(d, 0, c, bLen, dLen);
      System.arraycopy(e, 0, c, dLen, eLen);

      return c;
   }
